import { useMutation } from '@apollo/client';

const CREATE_USER = gql`
  mutation CreateUser($input: CreateUserInput!) {
    createUser(input: $input) {
      id
      name
      email
    }
  }
`;

function MyForm() {
  const [createUser, { loading, error }] = useMutation(CREATE_USER);

  async function handleSubmit(event) {
    event.preventDefault();

    const formData = new FormData(event.target);
    const input = {
      name: formData.get('name'),
      email: formData.get('email'),
      password: formData.get('password'),
    };

    try {
      const result = await createUser({ variables: { input } });
      console.log(`User created with ID ${result.data.createUser.id}`);
    } catch (err) {
      console.error(err);
    }
  }

  return (
    <form onSubmit={handleSubmit}>
      {/* ... */}
    </form>
  );
}
```
In this example, we use the `useMutation` hook provided by Apollo Client to execute the GraphQL mutation. We pass the `CREATE_USER` query as the first argument to `useMutation`, which returns a tuple containing the `createUser` function and an object with properties `loading` and `error`. The `createUser` function takes an object with a `variables` property, which contains the input values for the mutation.

